CREATE TABLE migrate.Parcel (
	parcel_id    serial      not null,
    num_um_uc_argos varchar(20) not null,
    num_bl          varchar(10),
    num_rd          numeric(8),
    num_sscc18_um   varchar(18),
    type_um         varchar(18),
    weight_um       numeric(13, 3),
    volume_um       numeric(13, 3),
    n_tracking_um   varchar(40),
    order_id   integer     not null, -- Link to Order table
    date_mod        timestamp,
    date_cre        timestamp,
	PRIMARY KEY (parcel_id)
);

